import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

export default function Created({loginID}) {
  const [studentData, setStudentData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:8081/Created');
        const data = await response.json();
        if (Array.isArray(data)) {
          setStudentData(data);
        } else {
          setStudentData([]);
        }
      } catch (error) {
        console.error('Error:', error);
        setStudentData([]); // If there's an error, set concertData to an empty array
      }
    };

    fetchData();
  }, []);

  return (
    <>
      {/* <div className='text-center'>
        <div className='btn-group' role='group' aria-label='Basic example'>
          <button type='button' className='btn btn-success'>
            <Link className='nav-link' aria-current='page' to='/Create'>
              Create New Student Registration
            </Link>
          </button>
          <button type='button' className='btn btn-warning'>
            <Link className='nav-link' aria-current='page' to='/Edit'>
              Edit Student Registration
            </Link>
          </button>
          <button type='button' className='btn btn-danger'>
            <Link className='nav-link' aria-current='page' to='/Delete'>
              Delete Student Registration
            </Link>
          </button>
        </div>
      </div> */}
      <h2 className='colorw'>New Book added</h2>
      <div>
  <table className="table">
    <thead>
      <tr>
        <th>Your ID</th>
        <th>Book  ID</th>
        <th>Cover</th>
        <th>Title</th>
        <th>Description</th>
        <th>Genre</th>
        <th>Publishing Date</th>
        <th>Price</th>
        <th>#Tags</th>
        <th>Status</th>
       
      </tr>
    </thead>
    <tbody>
      {studentData.map((student, index) => (
        <tr key={index}>
          <td>{loginID.loginID}</td>
          <td>{student.id}</td>
          <td>{student.cover}</td>
          <td>{student.title}</td>
          <td>{student.description}</td>
        <td>{student.genre}</td>
        <td>{student.publishDate}</td>
        <td>{student.price}</td>
        <td>{student.tags}</td>
        <td>{student.status}</td>
          
        </tr>
      ))}
    </tbody>
  </table>
</div>

    </>
  );
}
